// client/src/pages/Resume/Resume.js
import React, { useState, useEffect } from 'react';
import { Box, Typography, Divider, Button, List, ListItem, ListItemText } from '@mui/material';
import { motion } from 'framer-motion';
import { useLocation } from 'react-router-dom';
import './Resume.css';

export default function Resume() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const { search } = useLocation();
  const user = new URLSearchParams(search).get('user');

  useEffect(() => {
    fetch('http://localhost:5000/api/portfolio/resume')
      .then(res => res.json())
      .then(setData)
      .catch(console.error)
      .finally(() => setLoading(false));
  }, []);

  if (loading) {
    return (
      <Box className="resume-page">
        <Typography variant="h5" align="center" className="loading-text">
          Loading resume…
        </Typography>
      </Box>
    );
  }

  const entry = data.find(item => item.owner === user);
  if (!entry) {
    return (
      <Box className="resume-page">
        <Typography variant="h4" align="center" className="error-text">
          No resume found for "{user}"
        </Typography>
      </Box>
    );
  }

  const { summary, downloadUrl, education, experience, skills, certifications, awards } = entry.resume;

  return (
    <Box className="resume-page">
      {/* Header */}
      <motion.div
        className="resume-header"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <Typography variant="h3" className="resume-title">
          {entry.owner.charAt(0).toUpperCase() + entry.owner.slice(1)}'s Resume
        </Typography>
        <Typography variant="body1" className="resume-summary">
          {summary}
        </Typography>
        {downloadUrl && (
          <Button
            variant="contained"
            className="download-btn"
            href={downloadUrl}
            target="_blank"
          >
            Download PDF
          </Button>
        )}
      </motion.div>

      <Divider className="resume-divider" />

      {/* Education */}
      <motion.section
        className="resume-section"
        data-title="Education"
        initial={{ opacity: 0, scale: 0.95 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ delay: 0.4, duration: 0.6 }}
      >
        <Typography variant="h5" className="section-title">
          Education
        </Typography>
        <List>
          {education.map((ed, i) => (
            <ListItem key={i} className="list-item">
              <ListItemText
                primary={`${ed.degree}, ${ed.institution}`}
                secondary={`${ed.startDate} – ${ed.endDate} ${ed.fieldOfStudy ? `• ${ed.fieldOfStudy}` : ''}`}
              />
            </ListItem>
          ))}
        </List>
      </motion.section>

      {/* Experience */}
      <motion.section
        className="resume-section"
        data-title="Experience"
        initial={{ opacity: 0, scale: 0.95 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ delay: 0.6, duration: 0.6 }}
      >
        <Typography variant="h5" className="section-title">
          Experience
        </Typography>
        <List className="experience-list">
          {experience.map((exp, i) => (
            <ListItem key={i} className="list-item">
              <ListItemText
                primary={`${exp.role} at ${exp.company || exp.project}`}
                secondary={`${exp.startDate} – ${exp.endDate}`}
              />
              <Box className="exp-details">
                {exp.responsibilities.map((r, j) => (
                  <Typography key={j} variant="body2" className="detail-item">
                    • {r}
                  </Typography>
                ))}
              </Box>
            </ListItem>
          ))}
        </List>
      </motion.section>

      {/* Skills */}
      <motion.section
        className="resume-section"
        data-title="Skills"
        initial={{ opacity: 0, scale: 0.95 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ delay: 0.8, duration: 0.6 }}
      >
        <Typography variant="h5" className="section-title">
          Skills
        </Typography>
        <List className="inline-list">
          {skills.map((skill, i) => (
            <ListItem key={i} className="skill-tag">
              <Typography variant="body2">{skill}</Typography>
            </ListItem>
          ))}
        </List>
      </motion.section>

      {/* Certifications */}
      <motion.section
        className="resume-section"
        data-title="Certifications"
        initial={{ opacity: 0, scale: 0.95 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ delay: 1.0, duration: 0.6 }}
      >
        <Typography variant="h5" className="section-title">
          Certifications
        </Typography>
        <List>
          {certifications.map((c, i) => (
            <ListItem key={i} className="list-item">
              <ListItemText primary={`${c.name} • ${c.issuer}`} secondary={c.date} />
            </ListItem>
          ))}
        </List>
      </motion.section>

      {/* Awards */}
      <motion.section
        className="resume-section"
        data-title="Awards"
        initial={{ opacity: 0, scale: 0.95 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ delay: 1.2, duration: 0.6 }}
      >
        <Typography variant="h5" className="section-title">
          Awards
        </Typography>
        <List>
          {awards.map((a, i) => (
            <ListItem key={i} className="list-item">
              <ListItemText primary={a.title} secondary={a.date} />
            </ListItem>
          ))}
        </List>
      </motion.section>
    </Box>
  );
}
